import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import toDoList from "./toDoList";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <toDoList />
  </React.StrictMode>
);

